const handleSubmit = async (e) => {
  e.preventDefault();

  const { data, error } = await supabase.from('treatments').insert([
    {
      patient_id: patientId,
      practitioner: practitioner,
      date: date,
      treatment: treatment,
      location: location,
      memo: memo,
    },
  ]);

  if (error) {
    alert('エラーが発生しました：' + error.message);
  } else {
    console.log('登録されたデータ:', data);  // データを表示して警告を消す
    alert('施術情報を登録しました！');
    setPractitioner('');
    setDate('');
    setTreatment('');
    setLocation('');
    setMemo('');
  }
};
